import { Injectable } from '@angular/core';
import { Keys } from './storage-keys.enum';

@Injectable({
  providedIn: 'root'
})
export class LocalStorageService {

  constructor() { }

  read(key: string){
    return localStorage.getItem(key)
  }

  write(key: string, value: string){
    localStorage.setItem(key, value);
  }

  remove(key: string){
    localStorage.removeItem(key);
  }
}

import { Injectable } from '@angular/core';
import { BehaviorSubject } from 'rxjs';
import { Todo } from './todo.model';

@Injectable({
  providedIn: 'root'
})
export class TodoService {
  readonly todos$ = new BehaviorSubject<Todo[]>([]);

  constructor() { }

  addTodo(todo: Todo){
    const updatedArray = this.todos$.getValue();
    updatedArray.push(todo);
    this.todos$.next(updatedArray);
  }
}

import { Injectable } from '@angular/core';
import { MatDialog, MatDialogConfig } from '@angular/material/dialog';
import { MatSnackBar, MatSnackBarConfig } from '@angular/material/snack-bar';
import { Observable } from 'rxjs';
import { NameDialogComponent } from '../name-dialog/name-dialog.component';
import { SimpleDialogComponent } from './simple-dialog.component';

@Injectable({
  providedIn: 'root'
})
export class UiService {

  constructor(private snackBar: MatSnackBar, private dialog: MatDialog) { }

  showSnackbar(message: string, action = 'Close', config?: MatSnackBarConfig) {
    this.snackBar.open(message, action, config || { duration: 7000 })
  }

  showDialog(
    title: string,
    content: string,
    okText = 'OK',
    cancelText?: string,
    customConfig?: MatDialogConfig
  ): Observable<boolean> {
    const dialogRef = this.dialog.open(
      SimpleDialogComponent,
      customConfig || {
        width: '300px',
        data: { title, content, okText, cancelText },
      }
    )
    return dialogRef.afterClosed()
  }

  showNameDialog(): Observable<string> {
    const dialogRef = this.dialog.open(
      NameDialogComponent,
      {
        width: '300px',
        data: {name: ''}
      }
    )
    return dialogRef.afterClosed()
  }
}

import { Injectable } from '@angular/core';
import { BehaviorSubject } from 'rxjs';
import { LocalStorageService } from './common/local-storage.service';
import { Keys } from './common/storage-keys.enum';

@Injectable({
  providedIn: 'root'
})
export class UserDataService {
  readonly name$ = new BehaviorSubject<string>('guest');

  constructor(private storageService: LocalStorageService) {
    this.name$.next(this.storageService.read(Keys.Name) || 'guest')
  }

  updateName(newName: string){
    this.storageService.write(Keys.Name, newName);
    this.name$.next(newName);
  }
}

